import React from "react";
import "./ChatRoom.css";
import NavTopRoom from "./NavTopRoom/NavTopRoom";

class ChatRoom extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return <div className="chatroom">
      <div className="row">
        <div className="col">
          <div className="row">
            <NavTopRoom/>
          </div>
        </div>
      </div>
    </div>;
  }
}

export default ChatRoom;
